svg.script:
if (!top.sessionstorage) top.sessionstorage= [];
function s_save($param, $value) { 
    return top.sessionstorage[$param]= $value;
}
function s_load($param, $value) { 
    return top.sessionstorage[$param]?top.sessionstorage[$param]:$value;
}

var step2=0;

function onload(evt) {
    var target = evt.getTarget();
    doc = target.getOwnerDocument();
    xpselect();
 }

var pointzoom;
var inout;
function ZoomControlIn() {
    pointzoom=svgDocument.documentElement.currentScale*2;
    inout='in';
    ZoomControl();
}
function ZoomControlOut() {
    pointzoom=svgDocument.documentElement.currentScale/2;
    inout='out';    
    ZoomControl();
}
function ZoomControl() {
    var SVGRoot = svgDocument.documentElement;
	var w=getInnerWidth();
	var h=getInnerHeight();
	var x=-SVGRoot.currentTranslate.x + w/2
	var y=-SVGRoot.currentTranslate.y + h/2
	
	if (pointzoom>=0.0625 && pointzoom<=16) {	
  	  SVGRoot.currentScale = pointzoom;
	  if (SVGRoot.currentScale!=pointzoom) {setTimeout("ZoomControl()",50); return;}
	  if (inout=='out') {
	    SVGRoot.currentTranslate.x += x/2;
	    SVGRoot.currentTranslate.y += y/2;
	  }
	  else {
	    SVGRoot.currentTranslate.x -= x;
	    SVGRoot.currentTranslate.y -= y;
	  }	
	}
}
function ZoomPanReset() {
    var SVGRoot = svgDocument.documentElement;
	SVGRoot.currentScale = 1;
	if (SVGRoot.currentScale!=1) {setTimeout("ZoomPanReset()",50); return;}
	SVGRoot.currentTranslate.x = 0;
	SVGRoot.currentTranslate.y = 0;
}
function updatecontrol (evt) {
    var control = doc.getElementById("control");
    var x = 1;
    var y = 1;
    var SVGRoot = svgDocument.documentElement;
    var scale = SVGRoot.currentScale;
    var trans = SVGRoot.currentTranslate;
    var vbox = SVGRoot.getAttributeNS(null, "viewBox");
    var params  = vbox.split(/\s+/);
    var x1 = (-trans.x+x)/scale;
    var y1 = (-trans.y+y)/scale;  
    var h_scale = window.innerWidth / params[2];
    var v_scale = window.innerHeight / params[3];  
    if (h_scale>v_scale) box_scale=v_scale; 
    else box_scale=h_scale;
    var x_transl=(window.innerWidth-(box_scale*params[2]))/2;
    var y_transl=(window.innerHeight-(box_scale*params[3]))/2;  
    var vX = 1*params[0]; 
    var vY = 1*params[1]; 
    x1=(x1-x_transl)/box_scale+vX;
    y1=(y1-y_transl)/box_scale+vY;
    var toolscale =1/scale;
    toolscale=toolscale/box_scale;
    control.setAttribute ("transform", "translate("+x1+", "+y1+") scale("+toolscale+")");	
}    
function display(evt, id, disp) {
    var element = doc.getElementById(id);
    element.setAttribute ("display", disp);     
}

function LinkSelect(id, str) {
    var element = doc.getElementById(id);
    var elemscale = doc.getElementById("Tooltip");
    element.setAttribute ("class", str);
}
function ChangeClass(id, cvet) {
    var element = doc.getElementById(id);
    element.setAttribute ("class", cvet);
}


var stepcup2=0;
var stepcup3=0;
var stepcup4=0;
var cup; 
var cupstatus = new Array();

function CupMove(id) {
  if (cupstatus[id]==null) {
    if (id=='CUP2') CupAnimation2();
    if (id=='CUP3') CupAnimation3();  
    if (id=='CUP4') CupAnimation4();      
  }
}

function CupAnimation2() {
  cup = doc.getElementById('CUP2');
  if (stepcup2>=10) {
    stepcup2=stepcup2+10;
    if (stepcup2>450) {cupstatus['CUP2']=1;return;}
    cup.setAttribute ("transform", "translate("+ 1*stepcup2 +",10)");
  }
  else {stepcup2++; cup.setAttribute ("transform", "translate("+ -1*stepcup2 +","+ stepcup2 +")");}
  setTimeout("CupAnimation2()",10)
}
function CupAnimation3() {
  cup = doc.getElementById('CUP3');
  if (stepcup3>=10) {
    stepcup3=stepcup3+10;
    if (stepcup3>450) {cupstatus['CUP3']=1;return;}
    cup.setAttribute ("transform", "translate("+ 1*stepcup3 +",10)");
  }
  else {stepcup3++; cup.setAttribute ("transform", "translate("+ -1*stepcup3 +","+ stepcup3 +")");}
  setTimeout("CupAnimation3()",10)
}
function CupAnimation4() {
  cup = doc.getElementById('CUP4');
  if (stepcup4>=10) {
    stepcup4=stepcup4+10;
    if (stepcup4>450) {cupstatus['CUP4']=1;return;}
    cup.setAttribute ("transform", "translate("+ 1*stepcup4 +",10)");
  }
  else {stepcup4++; cup.setAttribute ("transform", "translate("+ -1*stepcup4 +","+ stepcup4 +")");}
  setTimeout("CupAnimation4()",10)
}  

function unselectall () {
ChangeClass('RS_SP', 'filredunsel');
ChangeClass('SP_sel', 'fil39 str15');
ChangeClass('RS_MVS', 'filredunsel'); 
ChangeClass('MVS_sel', 'fil39 str15');
}


function xpselect() {
  var modulname = s_load('highlight','');
  s_save('highlight','');
  selectmodul (modulname); 
}

function selectmodul (modulname) {
  unselectall ()
  switch (modulname) {
   case "MVS": ChangeClass('RS_MVS', 'filredsel'); ChangeClass('MVS_sel', 'filredselnop str15'); break;
   case "PCH": ChangeClass('RS_SP', 'filredsel'); ChangeClass('SP_sel', 'filredselnop str15'); break;

   case "": break;
  }
}


function updatetips(evt, helptext1, helptext2, bgsizex, bgsizey) {
    var ToolTip = doc.getElementById("Tooltip");
	var elemtext1 = doc.getElementById("Tooltext1");
	var elemtext2 = doc.getElementById("Tooltext2");
    var elembg = doc.getElementById("Toolbg");
    
	elemtext1=elemtext1.firstChild;
    elemtext1.data = helptext1;
	elemtext2=elemtext2.firstChild;
    elemtext2.data = helptext2;
	elembg.setAttribute ("width", bgsizex);
	elembg.setAttribute ("height", bgsizey);		

    var x = evt.screenX;
    var y = evt.screenY;
  
    var SVGRoot = svgDocument.documentElement;
    var scale = SVGRoot.currentScale;
    var trans = SVGRoot.currentTranslate;
    var vbox = SVGRoot.getAttributeNS(null, "viewBox");
    var params  = vbox.split(/\s+/);

    var x1 = (( 10.0 - trans.x )+x)/scale;
    var y1 = (( -15.0 - trans.y )+y)/scale;  
  
    var h_scale = window.innerWidth / params[2];
    var v_scale = window.innerHeight / params[3];  
 
    if (h_scale>v_scale) box_scale=v_scale; 
    else box_scale=h_scale;
  
  
    var x_transl=(window.innerWidth-(box_scale*params[2]))/2;
    var y_transl=(window.innerHeight-(box_scale*params[3]))/2;  
    x1=(x1-x_transl)/box_scale;
    y1=(y1-y_transl)/box_scale;
  
    var toolscale =1/scale;
    toolscale=toolscale/box_scale;
    
    var xtest=bgsizex*toolscale;
    var ytest=bgsizey*toolscale;
    if (x>(window.innerWidth-xtest) && (window.innerWidth-xtest)>0) x1=x1-xtest-((25.0/scale)/box_scale);
    if (y<ytest) y1=y1-((-30.0/scale)/box_scale);
         
    ToolTip.setAttribute ("transform", "translate("+x1+", "+y1+") scale("+toolscale+")");	
  }
